import React from 'react';
export class SearchBar extends React.Component {
    render () {
        return (
            <Fragment>
                <div class="form-group">
                    <label for="usr">Name:</label>
                    <input type="text" class="form-control" id="usr"/>
                </div>
            </Fragment>
        );

    }
}

export default SearchBar;
